SelectFiles = function showSelectFiles(){

	var filelistTag = ''

	try
	{
		var filelistElemnet = document.getElementById("filelist");
		if(null == filelist){
			return;
		}

		var selectlist = filelistElemnet.files;
		var filesCnt = selectlist.length;

		for(i = 0; i < filesCnt; i++){
			if(null == selectlist[i]){
				continue;
			}
			selectlist += "<li>"+selectlist[i].name+"</li>";
		}

		filelistElemnet.innerHTML = filelistTag;	
	}
	catch( _e )
	{
		console.log(_e);
	}
}
